let disposable = observable.observe(on: observer) { event in
    if case .next(let value) = event {
        onNext(value)
    }
}.removeDisposable(for: observer)

let disposable = observable.observe(on: observer) { event in
    if case .error(let error) = event {
        onError(error)
    }
}.removeDisposable(for: observer)

let disposable = observable.observe(on: observer) { event in
    if case .completed = event {
        onCompleted()
    }
}.removeDisposable(for: observer)

